pub struct Solution;

impl Solution {
    pub fn min_total_distance(grid: Vec<Vec<i32>>) -> i32 {
        use std::collections::VecDeque;

        let (n, m) = (grid.len(), grid[0].len());
        let mut distances = vec![vec![0; m]; n];
        let start_points = grid.iter().enumerate()
            .flat_map(|(i, row)| row.iter().enumerate().filter_map(move |(j, &el)| if el==1 { Some((i, j)) } else { None }))
            .collect::<Vec<_>>();
        let get_adjucent_points = |i: usize, j: usize| {
            let (i0, n) = (i.checked_sub(1).unwrap_or(i+1), (i+2).min(n));
            let (j0, m) = (j.checked_sub(1).unwrap_or(j+1), (j+2).min(m));
            (i0..n).step_by(2).map(move |ii| (ii, j)).chain((j0..m).step_by(2).map(move |jj| (i, jj)))
        };
        for (i, j) in start_points {
            let mut visited = vec![vec![false; m]; n];
            visited[i][j] = true;
            let mut queue = VecDeque::from(vec![(i,j)]);
            let mut distance = 0;
            while !queue.is_empty() {
                let size = queue.len();
                for _ in 0..size {
                    if let Some((i,j)) = queue.pop_front() {
                        distances[i][j] += distance;
                        for (ii, jj) in get_adjucent_points(i, j) {
                            if !visited[ii][jj] {
                                visited[ii][jj] = true;
                                queue.push_back((ii, jj));
                            }
                        }
                    }
                }
                distance += 1;
            }
        }
        distances.into_iter().flatten().min().unwrap()        
    }
}

